(CNN) -- 올레 군나르 솔샤르는 1999년 맨체스터 유나이티드를 구해 챔피언스리그 우승을 이끌었으며, 이제 그는 카디프 시티를 잉글랜드 축구 2부 리그로 추락하지 않도록 구해야 할 임무를 맡았다. 40세의 노르웨이인은 바르셀로나에서 맨유의 대체 선수 벤치에서 내려와 베이어 뮌헨과의 경기에서 추가 시간에 결승 골을 넣어 2-1 승리를 거둬 알렉스 퍼거슨 감독님의 트레블 우승을 이룩한 것으로 유명하다. 카디프의 말레이시아 소유주 빈센트 탄은 전 몰데 감독으로부터 후임으로 지명받은 솔샤르가 해결하기 어려운 위기에 처한 웨일즈 측면에서 비슷한 마술을 부릴 수 있길 바라고 있다. 
@highlight
카디프, 올레 군나르 솔샤르를 새로운 감독으로 지명
@highlight
말키 매케이의 후임으로 솔샤르가 임명됨
@highlight
노르웨이 몰데에서 감독을 지낸 후 첫 잉글랜드 감독직임

위 질문에서 "@placeholder"는 무엇을 의미하는가?

